import Home from './Components/Home';
import Header from './Components/Header';
import About from './Components/About';
import Contact from './Components/Contact';
import Bottom from './Components/Bottom';
import './reset.css';
import './App.css';

function App() {
  return (
    <div className="App">
          <div className="container">
            <Header />
            <Home />
              <About />
              <Contact />
            <Bottom />
          </div>
    </div>
  );
}

export default App;
